import React, { useState } from "react";
import ExpenseItem from "./ExpenseItem";
import Card from "./Card";
import "./Expenses.css";
import ExpensesFilter from "./ExpensesFilter";


const ExpenseList=(props)=>{
let emptyExpense = <strong><p className="p">Nothing Is in the Expenses</p> </strong>;

  if (props.length.items > 0) {
    emptyExpense = props.items.map((expense) => (
      <ExpenseItem
        key={expense.id}
        title={expense.title}
        amount={expense.amount}
        date={expense.date}
      />
    ));
  }
}

export default ExpenseList;
